import { Flex, VStack } from "@chakra-ui/react";

function App() {
  return (
    <VStack>
      <Flex w = "100%">
      <Heading
          ml="8" size="md" fontWeight='semibold' color="cyan.400">imthepk</Heading>
      </Flex>
    </VStack>
  );
}

export default App;
